import React,{Component} from "react";
import {Div0,DataInfoItem,Div3,DivDetail1} from'./sty';
import Header from '../header/index'

class DataInfoList extends Component{
    render(){
        return (
                <Div0>
                    <DataInfoItem>
                        <Div3>
                            <DivDetail1>user_id</DivDetail1>
                            <DivDetail1>2</DivDetail1>
                        </Div3>
                        <Div3>user_id</Div3>
                        <Div3>user_id</Div3>
                    </DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                    <DataInfoItem></DataInfoItem>
                </Div0>
        )}}
export default DataInfoList;
